import React  from 'react';
import Moment from 'react-moment';

export default class ProposalEndDate extends React.Component {
  render() {
      const date = new Date();

      return (
          <div>
              <Moment format="YYYY/MM/DD" add={{ hours: 48 }}>{date}</Moment>
             
          </div>
      );
  }
}
